import React from "react";

export default function DogCard({name, image, temperaments, weightMin, weightMax }){
    return (
        <div>
            <div>
            
                        <h1>DOGGI</h1>
                        <img src={image} alt={`${name}`}  />
                    </div>
                    <div>
                        <h1>{name}</h1>
                        <h2>Temperamento:</h2>
                        <h4>{function (temperaments) {
                            if (typeof (temperaments) === 'string') {
                                return temperaments
                            }
                            if (Array.isArray(temperaments)) {
                                let temps = temperaments.map(e => e.name)
                                return temps.join(', ')
                            }
                        }(temperaments)}</h4>
                        <h2>Peso:</h2>
                        <h4>De {weightMin} Kg. a {weightMax} Kg.</h4>
                    </div>
                    </div>
                
    )
}
